import React from 'react';
import TextItem from "./TextItem";

const TextList = ({texts}) => {
    return (
        <div>
            <h1>Проверь себя</h1>
            {texts.map(text =>
                <TextItem text={text} key={text.id}/>
            )}
        </div>
    );
};

export default TextList;
